import React, { Component } from 'react'

class List extends Component {
    render() {
        const listItem = ['test', 'test2', 'test3']
        const renderList = listItem.map((item, index) => <li key={index}>{item}</li>)
        return (
            {renderList}
        )
    }
}

export default List
